import React from 'react'

function StatPanel({panelClassName, headerClassName, stat, title, content}) {
    return (
        <main className={`problem-panel ${panelClassName}`}>
            <section className={`problem-header ${headerClassName}`}>
                <h2>
                    { stat }
                </h2>
                <h3 style={{color: 'var(--text-color)', width: '70%'}}>
                    { title }
                </h3>
            </section>
            <h3>
                { content }
            </h3>
        </main>
    );
}

export default StatPanel;
